script: |
  super -f text -I q5066.spq | sort > q5066.out

inputs:
  - name: q5066.spq
    data: |
      SELECT col0 * - col2 FROM tab0 (FORMAT parquet) WHERE col0 NOT BETWEEN col2 AND ( - 39 * col0 - + col1 );
  - name: tab0

outputs:
  - name: q5066.out
    data: |
      -705
      -870
      -9603
